    /// <summary>
    /// # Introduction
    ///
    /// This page documents the [LUSID APIs](https://api.lusid.com/swagger),
    /// which allows authorised clients to query and update their data within
    /// the LUSID platform.
    ///
    /// SDKs to interact with the LUSID APIs are available in the following
